import React from 'react';
import { Button, Input, Row, Col, Pagination, Form, Space, Select } from 'antd';
import { GetMyBooks } from '../../api';
import Banner from '../../components/Banner'
import './index.css';

export default class MyCenter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      myBooksList: []
    }
  }
  componentDidMount() {
    GetMyBooks(window.localStorage.userId).then(res => {
      if (res.data.code === 0) {
        this.setState({
          myBooksList: res.data.data,
        })
      }
    })
  }
  render() {
    return (
      <div className="home">
        <Banner />
        <h2>我借到的书</h2>
        <div className="search-result-box">
          <div className="search-result">
            <img src='http://www.lib.ecnu.edu.cn/_upload/article/images/ff/85/6620697649db94e4a792a575004d/fc82c0c9-bf05-4c46-90fb-00a25d2187b8_s.jpg' alt='' />
            <div className="search-result-item">
              <div>题名:</div>
              <div>作者:</div>
              <div>出版社:</div>
              <div>简介:简介简介简介简介简介简介简介简介简介简介简简介简介简介简介简简介简介简介简介简介简介简介</div>
            </div>
          </div>
        </div>
        <br /><br />
      </div>
    );
  }
}
